INSERT INTO `albums` (`id`, `name`, `year`, `description`, `spotify_link`, `base64image`)
VALUES
	(2,'Metaphorical Music',2003,'Metaphorical Music is the debut studio album by Japanese musician Nujabes. Released in 2003, it offers a combination of hip hop and instrumental jazz, and features artists like Shing02, Substantial, Five Deez and Cise Starr (of CYNE). ','https://open.spotify.com/embed/album/5FrjDW96mCYw9ECc74c637','data:image/jpeg;base64,'),
	(3,'Modal Soul',2005,'Modal Soul is the second full-length album by Japanese hip-hop artist Nujabes, released on November 11, 2005, on Nujabes\' own record label Hydeout Productions. Like its predecessor, Metaphorical Music, Modal Soul fuses jazzy, smooth rhythms and hip hop.','https://open.spotify.com/embed/album/6nVACH6a27eOWiumAJhDWS','data:image/jpeg;base64,');

INSERT INTO `albums` (`id`, `name`, `year`, `description`, `spotify_link`, `base64image`)
VALUES
	(4,'freedom of the son',2014,'Freedom of the Son is the second album by Uyama Hiroto, released via Roph Recordings on October 18, 2014. It features collaborations with various artists, along with returning collaborator Cise Starr. \n\nAlthough the album is considered as hip-hop, it incorporates jazzy sounds of multi-layered piano, guitar, saxophone, and keyboards, and various samples.','https://open.spotify.com/embed/album/73cM7LsGHZA7sHlOYrOMAS','data:image/jpeg;base64,');

INSERT INTO `albums` (`id`, `name`, `year`, `description`, `spotify_link`, `base64image`)
VALUES
	(5,'Luv (Sic) Hexalogy',2015,'Luv(sic) Hexalogy is an album collaboration created and finalized posthumously by the Japanese producer Nujabes[1] and Japanese hip hop artist Shing02. It is a jazz hip hop album that incorporates latin jazz/soul samples and drum beats to create the instrumentals. The scratching was performed by various DJs and the vocals/lyrics were created by Shing02.','https://open.spotify.com/embed/album/4oT4YRVe43ESrT9rx2LKCM','data:image/jpeg;base64,'),
	(9,'a son of the sun',2008,'The album has the rhythm and flow of free form poetry, yet speaks very little. It’s a hip-hop record at its core, but like a handful of his Japanese contemporaries, Hiroto utilizes the smooth, fresh nature of jazz. \n\nThink the late Nujabes, with less emphasis on the “emcee” aspect, and more on the instrumentation and fusion of sounds. There’s typically so much going on, but it’s so masterfully structured, that it seems like he merely happened upon these beats and. these rhythms. A piano glissando here, and a saxophone solo there--it all feels so painfully natural.\n\nThe songs are structured in a way that it feels like a sunset. “81summer” and “Climbed Mountain” open up with more liveliness than present on the rest of the album, while each subsequent track takes this down a notch.. Added to that, nearly every song has a specific flavor. \n\nWhether it be a dash of tranquility, or a spoonful of sexy, there’s something special that makes many of the tracks standout. \n\nIt’s a hectic but beautiful album, with subdued chanting and multifarious beats coming from all sides. ','https://open.spotify.com/embed/album/3lWDRI6LLRZqPbCK7xBeAp','data:image/jpeg;base64,');

