INSERT INTO `artists` (`id`, `name`, `description`, `base64image`)
VALUES
	(6,'Uyama Hiroto','Hiroto Uyama is a Japanese saxophonist, multi-instrumentalist, and producer. He has frequently collaborated with Nujabes.\n\nExamples of this collaboration is Hiroto producing \"Letter From Yokosuka\", playing additional instruments on the tracks \"Kumomi\", \"Next View\" & \"Modal Soul\", releasing remixes of \"Highs 2 Lows\" & \"Thank You\", and contributing tracks to the compilation album Hydeout Productions 2nd Collection. \n\nHis solo album \"A Son of the Sun\" was released in July 2008.','data:image/jpeg;base64,'),
	(7,'Nujabes','Jun Seba (Japanese: 瀬葉 淳, Hepburn: Seba Jun, February 7, 1974 – February 26, 2010), better known by his stage name Nujabes (ヌジャベス, Nujabesu), was a Japanese record producer, audio engineer, DJ, composer and arranger best known for his atmospheric instrumental mixes sampling from hip hop, soul, and jazz, as well as incorporating elements of trip hop, breakbeat, downtempo, and ambient music.','data:image/jpeg;base64,'),
	(8,'Cise Starr','Cise Starr is a rapper from Gainesville, Florida. He is most known for his songs with Nujabes. His music style is mostly indie hip hop.\n\nCise Starr is one of the founders of Cyne (Cultivating Your New Experience). The group aim to create sincere Hip Hop music with a message and a warm, soulful and organic production.\n\nTheir tracks are politically charged, with culturally introspective, motivational lyrical content rooted in blues, jazz, highlife, activism, humanities and philosophy.','data:image/jpeg;base64,');

INSERT INTO `artists` (`id`, `name`, `description`, `base64image`)
VALUES
	(9,'Shing02','Shingo Annen, better known by his stage name Shing02, is a Japanese hip hop recording artist, record producer, activist and investor. He was described by Patrick Neate as one of the Japanese emcees who \"has addressed important issues from Japanese ethnicity to sexual exploitation to the education system\".','data:image/jpeg;base64,');

